// SPDX-License-Identifier: MIT

pragma solidity >=0.7.0;
pragma abicoder v2;

import './SPLToken.sol';
import './Metaplex.sol';

SPLToken constant _splToken = SPLToken(0xFf00000000000000000000000000000000000004);
Metaplex constant _metaplex = Metaplex(0xff00000000000000000000000000000000000005);

contract ERC20ForSpl {

    bytes32 immutable public tokenMint;

    mapping(address => mapping(address => uint256)) private _allowances;

    event Transfer(address indexed from, address indexed to, uint256 amount);
    event Approval(address indexed owner, address indexed spender, uint256 amount);

    event ApprovalSolana(address indexed owner, bytes32 indexed spender, uint64 amount);
    event TransferSolana(address indexed from, bytes32 indexed to, uint64 amount);

    constructor(bytes32 _tokenMint) {
        require(_splToken.getMint(_tokenMint).isInitialized, "ERC20: invalid token mint");
        require(_metaplex.isInitialized(_tokenMint), "ERC20: missing MetaPlex metadata");

        tokenMint = _tokenMint;
    }

    function name() public view returns (string memory) {
        return _metaplex.name(tokenMint);
    }

    function symbol() public view returns (string memory) {
        return _metaplex.symbol(tokenMint);
    }

    function decimals() public view returns (uint8) {
        return _splToken.getMint(tokenMint).decimals;
    }

    function totalSupply() public view returns (uint256) {
        return _splToken.getMint(tokenMint).supply;
    }

    function balanceOf(address who) public view returns (uint256) {
        bytes32 account = _solanaAccount(who);
        return _splToken.getAccount(account).amount;
    }

    function allowance(address owner, address spender) public view returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public returns (bool) {
        address owner = msg.sender;

        _approve(owner, spender, amount);

        return true;
    }

    function transfer(address to, uint256 amount) public returns (bool) {
        address from = msg.sender;

        _transfer(from, to, amount);

        return true;
    }


    function transferFrom(address from, address to, uint256 amount) public returns (bool) {
        address spender = msg.sender;

        _spendAllowance(from, spender, amount);
        _transfer(from, to, amount);

        return true;
    }

    function burn(uint256 amount) public returns (bool) {
        address from = msg.sender;

        _burn(from, amount);

        return true;
    }


    function burnFrom(address from, uint256 amount) public returns (bool) {
        address spender = msg.sender;

        _spendAllowance(from, spender, amount);
        _burn(from, amount);

        return true;
    }


    function approveSolana(bytes32 spender, uint64 amount) public returns (bool) {
        address from = msg.sender;
        bytes32 fromSolana = _solanaAccount(from);

        if (amount > 0) {
            _splToken.approve(fromSolana, spender, amount);
        } else {
            _splToken.revoke(fromSolana);
        }

        emit Approval(from, address(0), amount);
        emit ApprovalSolana(from, spender, amount);

        return true;
    }

    function transferSolana(bytes32 to, uint64 amount) public returns (bool) {
        address from = msg.sender;
        bytes32 fromSolana = _solanaAccount(from);

        _splToken.transfer(fromSolana, to, uint64(amount));

        emit Transfer(from, address(0), amount);
        emit TransferSolana(from, to, amount);

        return true;
    }

    function claim(bytes32 from, uint64 amount) external returns (bool) {
        return claimTo(from, msg.sender, amount);
    }

    function claimTo(bytes32 from, address to, uint64 amount) public returns (bool) {
        bytes32 toSolana = _solanaAccount(to);

        if (_splToken.isSystemAccount(toSolana)) {
            _splToken.initializeAccount(_salt(to), tokenMint);
        }

        _splToken.transferWithSeed(_salt(msg.sender), from, toSolana, amount);

        emit Transfer(address(0), to, amount);

        return true;
    }

    function _approve(address owner, address spender, uint256 amount) internal {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _spendAllowance(address owner, address spender, uint256 amount) internal {
        uint256 currentAllowance = allowance(owner, spender);
        if (currentAllowance != type(uint256).max) {
            require(currentAllowance >= amount, "ERC20: insufficient allowance");
            _approve(owner, spender, currentAllowance - amount);
        }
    }

    function _burn(address from, uint256 amount) internal {
        require(from != address(0), "ERC20: burn from the zero address");
        require(amount <= type(uint64).max, "ERC20: burn amount exceeds uint64 max");

        bytes32 fromSolana = _solanaAccount(from);

        require(_splToken.getAccount(fromSolana).amount >= amount, "ERC20: burn amount exceeds balance");
        _splToken.burn(tokenMint, fromSolana, uint64(amount));

        emit Transfer(from, address(0), amount);
    }

    function _transfer(address from, address to, uint256 amount) internal {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        bytes32 fromSolana = _solanaAccount(from);
        bytes32 toSolana = _solanaAccount(to);

        require(amount <= type(uint64).max, "ERC20: transfer amount exceeds uint64 max");
        require(_splToken.getAccount(fromSolana).amount >= amount, "ERC20: transfer amount exceeds balance");

        if (_splToken.isSystemAccount(toSolana)) {
            _splToken.initializeAccount(_salt(to), tokenMint);
        }

        _splToken.transfer(fromSolana, toSolana, uint64(amount));

        emit Transfer(from, to, amount);
    }

    function _salt(address account) internal pure returns (bytes32) {
        return bytes32(uint256(uint160(account)));
    }

    function _solanaAccount(address account) internal pure returns (bytes32) {
        return _splToken.findAccount(_salt(account));
    }
}

contract ERC20ForSplMintable is ERC20ForSpl {
    address immutable _admin;

    constructor(
        string memory _name,
        string memory _symbol,
        uint8 _decimals,
        address _mint_authority
    ) ERC20ForSpl(_initialize(_name, _symbol, _decimals)) {
        _admin = _mint_authority;
    }

    function findMintAccount() public pure returns (bytes32) {
        return _splToken.findAccount(bytes32(0));
    }

    function mint(address to, uint256 amount) public {
        require(msg.sender == _admin, "ERC20: must have minter role to mint");
        require(to != address(0), "ERC20: mint to the zero address");
        require(amount <= type(uint64).max, "ERC20: mint amount exceeds uint64 max");
        require(totalSupply() + amount <= type(uint64).max, "ERC20: total mint amount exceeds uint64 max");

        bytes32 toSolana = _solanaAccount(to);
        if (_splToken.isSystemAccount(toSolana)) {
            _splToken.initializeAccount(_salt(to), tokenMint);
        }

        _splToken.mintTo(tokenMint, toSolana, uint64(amount));

        emit Transfer(address(0), to, amount);
    }

    function _initialize(
        string memory _name,
        string memory _symbol,
        uint8 _decimals
    ) private returns (bytes32) {
        bytes32 mintAddress = _splToken.initializeMint(bytes32(0), _decimals);
        _metaplex.createMetadata(mintAddress, _name, _symbol, "");
        return mintAddress;
    }
}

contracts/ERC20ForSplFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.5.12;

import './ERC20ForSpl.sol';

contract ERC20ForSplFactory {

    mapping(bytes32 => address) public getErc20ForSpl;
    address[] public allErc20ForSpl;

    event ERC20ForSplCreated(bytes32 _mint, address pair, uint);

    function allErc20ForSplLength() external view returns (uint) {
        return allErc20ForSpl.length;
    }

    function createErc20ForSpl(bytes32 _mint) public returns (address erc20spl) {

        require(getErc20ForSpl[_mint] == address(0), 'ERC20 SPL Factory: ERC20_SPL_EXISTS');

        bytes memory bytecode = type(ERC20ForSpl).creationCode;
        bytecode = abi.encodePacked(bytecode, abi.encode(_mint));
        bytes32 salt = keccak256(abi.encodePacked(_mint));
        assembly {
            erc20spl := create2(0, add(bytecode, 32), mload(bytecode), salt)
        }
        require(erc20spl != address(0), 'ERC20 SPL Factory: SPL TOKEN IS NOT CREATED');

        getErc20ForSpl[_mint] = erc20spl;
        allErc20ForSpl.push(erc20spl);

        emit ERC20ForSplCreated(_mint, erc20spl, allErc20ForSpl.length);
    }

    function createErc20ForSplMintable(string memory _name, string memory _symbol, uint8 _decimals, address _mint_authority) public returns (address erc20spl) {

        bytes memory bytecode = type(ERC20ForSplMintable).creationCode;
        bytecode = abi.encodePacked(bytecode, abi.encode(_name, _symbol, _decimals, _mint_authority));
        bytes32 salt = keccak256(abi.encodePacked(bytes32(0)));
        assembly {
            erc20spl := create2(0, add(bytecode, 32), mload(bytecode), salt)
        }
        require(erc20spl != address(0), 'ERC20 SPL Factory: SPL TOKEN MINTABLE IS NOT CREATED');

        bytes32 _mint = ERC20ForSplMintable(erc20spl).findMintAccount();
        getErc20ForSpl[_mint] = erc20spl;
        allErc20ForSpl.push(erc20spl);

        emit ERC20ForSplCreated(_mint, erc20spl, allErc20ForSpl.length);
    }
}

contracts/interfaces/ICallSolana.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

interface ICallSolana {
    struct Instruction {
        bytes32 program_id;
        AccountMeta[] accounts;
        bytes instruction_data;
    }

    struct AccountMeta {
        bytes32 account;
        bool is_signer;
        bool is_writable;
    }

    // Returns Solana address for Neon address.
    // Calculates as PDA([ACCOUNT_SEED_VERSION, Neon-address], evm_loader_id)
    function getNeonAddress(address) external view returns (bytes32);


    // Returns Solana address of resource for contracts.
    // Calculates as PDA([ACCONT_SEED_VERSION, "ContractData", msg.sender, salt], evm_loader_id)
    function getResourceAddress(bytes32 salt) external view returns (bytes32);


    // Creates resource with specified salt.
    // Return the Solana address of the created resource (see `getResourceAddress`)
    function createResource(bytes32 salt, uint64 space, uint64 lamports, bytes32 owner) external returns (bytes32);


    // Returns Solana PDA generated from specified program_id and seeds
    function getSolanaPDA(bytes32 program_id, bytes memory seeds) external view returns (bytes32);


    // Returns Solana address of the external authority.
    // Calculates as PDA([ACCOUNT_SEED_VERSION, "AUTH", msg.sender, salt], evm_loader_id)
    function getExtAuthority(bytes32 salt) external view returns (bytes32); // delegatePDA


    // Return Solana address for payer account (if instruction required some account to funding new created accounts)
    // Calculates as PDA([ACCOUNT_SEED_VERSION, "PAYER", msg.sender], evm_loader_id)
    function getPayer() external view returns (bytes32);


    // Execute the instruction with a call to the Solana program.
    // Guarantees successful execution of call after a success return.
    // Note: If the call was unsuccessful, the transaction fails (due to Solana's behaviour).
    // The `lamports` parameter specifies the amount of lamports that can be required to create new accounts during execution.
    //   This lamports transferred to `payer`-account (see `getPayer()` function) before the call.
    // - `instruction` - instruction which should be executed
    // This method uses PDA for sender to authorize the operation (`getNeonAddress(msg.sender)`)
    // Returns the returned data of the executed instruction (if program returned the data is equal to the program_id of the instruction)
    function execute(uint64 lamports, Instruction memory instruction) external returns (bytes memory);


    // Execute the instruction with call to the Solana program.
    // Guarantees successful execution of call after a success return.
    // Note: If the call was unsuccessful, the transaction fails (due to Solana's behaviour).
    // The `lamports` parameter specifies the amount of lamports that can be required to create new accounts during execution.
    //   This lamports transferred to `payer`-account (see `getPayer()` function) before the call.
    // - `salt` - the salt to generate an address of external authority (see `getExtAuthority()` function)
    // - `instruction` - instruction which should be executed
    // This method uses external authority to authorize the operation (`getExtAuthority(salt)`)
    // Returns the returned data of the executed instruction (if program returned the data is equal to the program_id of the instruction)
    function executeWithSeed(uint64 lamports, bytes32 salt, Instruction memory instruction) external returns (bytes memory);


    // Execute the instruction with a call to the Solana program.
    // Guarantees successful execution of call after a success return.
    // Note: If the call was unsuccessful, the transaction fails (due to Solana's behaviour).
    // The `lamports` parameter specifies the amount of lamports that can be required to create new accounts during execution.
    //   This lamports transferred to `payer`-account (see `getPayer()` function) before the call.
    // - `instruction` - bincode serialized instruction which should be executed
    // This method uses PDA for sender to authorize the operation (`getNeonAddress(msg.sender)`)
    // Returns the returned data of the executed instruction (if program returned the data is equal to the program_id of the instruction)
    function execute(uint64 lamports, bytes memory instruction) external returns (bytes memory);


    // Execute the instruction with call to the Solana program.
    // Guarantees successful execution of call after a success return.
    // Note: If the call was unsuccessful, the transaction fails (due to Solana's behaviour).
    // The `lamports` parameter specifies the amount of lamports that can be required to create new accounts during execution.
    //   This lamports transferred to `payer`-account (see `getPayer()` function) before the call.
    // - `salt` - the salt to generate an address of external authority (see `getExtAuthority()` function)
    // - `instruction` - bincode serialized instruction which should be executed
    // This method uses external authority to authorize the operation (`getExtAuthority(salt)`)
    // Returns the returned data of the executed instruction (if program returned the data is equal to the program_id of the instruction)
    function executeWithSeed(uint64 lamports, bytes32 salt, bytes memory instruction) external returns (bytes memory);


    // Returns the program_id and returned data of the last executed instruction (if no return data was set returns zeroed bytes)
    // For more information see: https://docs.rs/solana-program/latest/solana_program/program/fn.get_return_data.html
    // Note: This method should be called after a call to `execute`/`executeWithSeed` methods
    function getReturnData() external view returns (bytes32, bytes memory);
}


/* Note:
    For `execute`/`executeWithSeed` methods which gets instruction in bincode serialized format
    the instruction should be serialized according to Solana bincode serialize rules. It requires
    serialized data in the following form:

    program_id as bytes32
    len(accounts) as uint64le
        account as bytes32
        is_signer as bool
        is_writable as bool
    len(data) as uint64le
        data (see instruction to Solana program)

The optimized way to serailize instruction is write this code on the solidity assembler.
To perform a call to `execute()` and `executeWithSeed()` methods the next code-sample can be helpful:
```solidity
    {
        // TokenkegQfeZyiNwAJbNbGKPFXCWuBvf9Ss623VQ5DA
        bytes32 program_id = 0x06ddf6e1d765a193d9cbe146ceeb79ac1cb485ed5f5b37913a8cf5857eff00a9;
        bytes32 owner = getNeonAddress(address(this));

        bytes4 selector = bytes4(keccak256("execute(uint64,bytes)"));
        bool success;
        assembly {
            let buff := mload(0x40)    // the head of heap
            let pos := buff            // current write position

            // selector
            mstore(pos, selector)      // write the method selector
            pos := add(pos, 4)

            // Write arguments to call the method
            // lamports
            mstore(pos, 0)             // write required lamports
            pos := add(pos, 32)

            // offset for instruction
            // specify the position of serialized instruction relative to start of arguments
            mstore(pos, sub(add(pos, 28), buff))
            pos := add(pos, 32)
            let size_pos := pos        // Save size position of serialized instruction
            pos := add(pos, 32)

            // program_id
            mstore(pos, program_id)
            pos := add(pos, 32)

            // len(accounts)
            mstore(pos, 0)
            mstore8(pos, 4)
            pos := add(pos, 8)

            // For each account in accounts array:
                // AccountMeta(resource, false, true)
                mstore(pos, owner)        // pubkey
                mstore8(add(pos, 32), 1)  // is_signer
                mstore8(add(pos, 33), 0)  // is_writable
                pos := add(pos, 34)

            // len(instruction_data)  if it shorter than 256 bytes
            mstore(pos, 0)            // fill with zero next 32 bytes
            mstore8(pos, 1)           // write the length of data
            pos := add(pos, 8)

            // instruction_data: InitializeAccount
            mstore8(pos, 1)           // Use Solana program instruction to detailed info
            pos := add(pos, 1)

            mstore(size_pos, sub(sub(pos, size_pos), 32))  // write the size of serialized instruction 
            let length := sub(pos, buff)      // calculate the length of arguments
            mstore(0x40, pos)                 // update head of heap
            success := call(5000, 0xFF00000000000000000000000000000000000006, 0, buff, length, buff, 0x20)
            mstore(0x40, buff)                // restore head of heap
        }
        if (success == false) {
            revert("Can't execute instruction");
        }
    }
```
*/

