contracts/SPLToken.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity >=0.7.0;
pragma abicoder v2;

interface SPLToken {

    enum AccountState {
        Uninitialized,
        Initialized,
        Frozen
    }

    struct Account {
        bytes32 mint;
        bytes32 owner;
        uint64 amount;
        bytes32 delegate;
        uint64 delegated_amount;
        bytes32 close_authority;
        AccountState state;
    }

    struct Mint {
        uint64 supply;
        uint8 decimals;
        bool isInitialized;
        bytes32 freezeAuthority;
        bytes32 mintAuthority;
    }

    function findAccount(bytes32 salt) external pure returns(bytes32);

    function isSystemAccount(bytes32 account) external view returns(bool);

    // Return spl_token account data. This function checks the account is owned by correct spl_token.
    // Return default not initialized spl_token account data if corresponded Solana account doesn't exist.
    function getAccount(bytes32 account) external view returns(Account memory);

    // Return spl_token mint data. This function checks the mint is owned by correct spl_token.
    // Return default not initialized spl_token mint data if corresponded Solana account doesn't exist.
    function getMint(bytes32 account) external view returns(Mint memory);

    function initializeMint(bytes32 salt, uint8 decimals) external returns(bytes32);
    function initializeMint(bytes32 salt, uint8 decimals, bytes32 mint_authority, bytes32 freeze_authority) external returns(bytes32);

    function initializeAccount(bytes32 salt, bytes32 mint) external returns(bytes32);
    function initializeAccount(bytes32 salt, bytes32 mint, bytes32 owner) external returns(bytes32);

    function closeAccount(bytes32 account) external;

    function mintTo(bytes32 mint, bytes32 account, uint64 amount) external;
    function burn(bytes32 mint, bytes32 account, uint64 amount) external;

    function approve(bytes32 source, bytes32 target, uint64 amount) external;
    function revoke(bytes32 source) external;

    function transfer(bytes32 source, bytes32 target, uint64 amount) external;

    // transfer funds from spl-token accounts owned by Solana user.
    // This method uses PDA[ACCOUNT_SEED_VERSION, b"AUTH", msg.sender, seed] to authorize transfer
    function transferWithSeed(bytes32 seed, bytes32 source, bytes32 target, uint64 amount) external;

    function freeze(bytes32 mint, bytes32 account) external;
    function thaw(bytes32 mint, bytes32 account) external;
}

contracts/TestNeonOracleToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import { IERC20ForSPL } from './interfaces/IERC20ForSPL.sol';
import { ICallSolana } from './interfaces/ICallSolana.sol';
import { CallSolanaHelperLib } from './CallSolanaHelperLib.sol';
import { SolanaDataConverterLib } from "./SolanaDataConverterLib.sol";

contract TestNeonOracleToken {
    ICallSolana public constant CALL_SOLANA = ICallSolana(0xFF00000000000000000000000000000000000006);
    bytes32 public constant TOKEN_PROGRAM = 0x06ddf6e1d765a193d9cbe146ceeb79ac1cb485ed5f5b37913a8cf5857eff00a9;
    bytes32 public constant ASSOCIATED_TOKEN_PROGRAM = 0x8c97258f4e2489f1bb3d1029148e0d830b5a1399daff1084048e7bd8dbe9f859;
    address public immutable token;

    constructor(address _token) {
        token = _token;
    }

    function getNeonAddress(address evm_address) public view returns(bytes32) {
        return CALL_SOLANA.getNeonAddress(evm_address);
    }

    function transfer(uint64 amount, bytes32 receiver) external {
        require(amount > 0, 'ERROR: INVALID AMOUNT');

        bytes32 tokenMint = IERC20ForSPL(token).tokenMint();
        bytes32 senderATA = getAssociateTokenAccount(
            CALL_SOLANA.getNeonAddress(address(this)), 
            TOKEN_PROGRAM,
            tokenMint
        );

        bytes32 recipientATA = getAssociateTokenAccount(
            receiver,
            TOKEN_PROGRAM,
            tokenMint
        );

        // transfer the tokens from the user to the contract's arbitrary Token account = owner = Neon EVM Program
        IERC20ForSPL(token).transferFrom(msg.sender, address(this), amount);

        // transfer the tokens from the contract's arbitrary Token account to contract's ATA account
        IERC20ForSPL(token).transferSolana(
            senderATA,
            amount
        );

        // Build the Solana transfer instruction data
        (
            bytes32[] memory accounts,
            bool[] memory isSigner,
            bool[] memory isWritable,
            bytes memory data
        ) = _formatTransferInstruction(
            senderATA, 
            recipientATA, 
            CALL_SOLANA.getNeonAddress(address(this)), 
            amount
        );

        // Format the Solana transfer instruction data
        bytes memory transferInstruction = CallSolanaHelperLib.prepareSolanaInstruction(
            TOKEN_PROGRAM,
            accounts,
            isSigner,
            isWritable,
            data
        );

        // Execute the transfer instruction
        CALL_SOLANA.execute(0, transferInstruction);
    }

    function getAssociateTokenAccount(bytes32 owner, bytes32 programId, bytes32 mint) public view returns(bytes32) {
        return CALL_SOLANA.getSolanaPDA(
            ASSOCIATED_TOKEN_PROGRAM,
            abi.encodePacked(
                owner,
                programId,
                mint
            )
        );
    }

    function _formatTransferInstruction(
        bytes32 senderATA,
        bytes32 recipientATA,
        bytes32 sender,
        uint64 amount
    ) internal pure returns (
        bytes32[] memory accounts,
        bool[] memory isSigner,
        bool[] memory isWritable,
        bytes memory data
    ) {
        accounts = new bytes32[](3);
        accounts[0] = senderATA;
        accounts[1] = recipientATA;
        accounts[2] = sender;

        isSigner = new bool[](3);
        isSigner[0] = false;
        isSigner[1] = false;
        isSigner[2] = true;

        isWritable = new bool[](3);
        isWritable[0] = true;
        isWritable[1] = true;
        isWritable[2] = false;

        // Get amount in right-padded little-endian format
        bytes32 amountLE = bytes32(SolanaDataConverterLib.readLittleEndianUnsigned256(uint256(amount)));
        data = abi.encodePacked(
            bytes1(0x03), // Instruction variant (see: https://github.com/solana-program/token/blob/08aa3ccecb30692bca18d6f927804337de82d5ff/program/src/instruction.rs#L506)
            bytes8(amountLE) // Amount (right-padded little-endian)
        );
    }
}

